		add("application",
				"{\"term\":\"application\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Late Middle english (1100-1500) \u0027applicacioun\u0027 from Old french (842-ca. 1400) \u0027aplicacion\u0027 (French \u0027application\u0027 , from Latin {{m|la|applicātiōnem}}, accusative singular of {{m|la|applicātiō||attachment; application, inclination}}, from {{m|la|applicō||join to, attach; apply}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of applying or laying on, in a literal sense; as, the application of emollients to a diseased limb\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The thing applied\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Johnso\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He invented a new \u0027\u0027application\u0027\u0027 by which blood might be stanched\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1857\u0027\u0027, John Eadie, ‎John Francis Waller, ‎William John Macquorn Rankine, \u0027The Imperial Dictionary of Universal Biography\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"His body was stripped, laid out upon a table, and covered with a hearsecloth, when some of his attendants perceived symptoms of returning animation, and by the use of warm \u0027\u0027applications\u0027\u0027, internal and external, gradually restored him to life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of applying as a means; the employment of means to accomplish an end; specific use\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"If a right course be taken with children, there will not be much need of the \u0027\u0027application\u0027\u0027 of the common rewards and punishments\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The act of directing or referring something to a particular case, to discover or illustrate agreement or disagreement, fitness, or correspondence\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I make the remark, and leave you to make the \u0027\u0027application\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027application\u0027\u0027 of a theory to a set of data can be challenging\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A computer program or the set of software that the end user perceives as a single entity as a tool for a well-defined purpose. (Also called: application program; application software\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"This iPhone \u0027\u0027application\u0027\u0027 can connect to most social networks\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A verbal or written request for assistance or employment or admission to a school\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"December 31 is the deadline for MBA \u0027\u0027applications\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A petition, entreaty, or other request\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Their \u0027\u0027application\u0027\u0027 for a deferral of the hearing was granted\", \"priority\":17}]}, \"synonyms\":{}}");

